public class InnerRouteGrpcRouteFactory(Action<Humidifier.AppMesh.RouteTypes.GrpcRoute> factoryAction = null) : SubResourceFactory<Humidifier.AppMesh.RouteTypes.GrpcRoute>
{

    internal InnerRouteGrpcRouteActionFactory ActionFactory { get; set; }

    internal InnerRouteGrpcTimeoutFactory TimeoutFactory { get; set; }

    internal InnerRouteGrpcRetryPolicyFactory RetryPolicyFactory { get; set; }

    internal InnerRouteGrpcRouteMatchFactory MatchFactory { get; set; }

    protected override Humidifier.AppMesh.RouteTypes.GrpcRoute Create()
    {
        var grpcRouteResult = CreateGrpcRoute();
        factoryAction?.Invoke(grpcRouteResult);

        return grpcRouteResult;
    }

    private Humidifier.AppMesh.RouteTypes.GrpcRoute CreateGrpcRoute()
    {
        var grpcRouteResult = new Humidifier.AppMesh.RouteTypes.GrpcRoute();

        return grpcRouteResult;
    }
    public override void CreateChildren(Humidifier.AppMesh.RouteTypes.GrpcRoute result)
    {
        base.CreateChildren(result);

        result.Action ??= ActionFactory?.Build();
        result.Timeout ??= TimeoutFactory?.Build();
        result.RetryPolicy ??= RetryPolicyFactory?.Build();
        result.Match ??= MatchFactory?.Build();
    }

} // End Of Class

